The official app of FIBA Women’s EuroBasket 2021!

It provides you with a unique and complete coverage of Europe's premier women’s basketball competition, featuring the world’s best players. The event is set to take place from June 17-27, 2021, and will be co-hosted by France and Spain.
Follow Belarus, Belgium, Bosnia and Herzegovina, Croatia, Czech Republic, France, Greece, Italy, Montenegro, Russia, Serbia, Slovakia, Slovenia, Spain, Sweden and Turkey in their quest to be crowned European champions!
Download it now and:
- Create your own experience, and follow your favorite teams and players;
- Follow the games live and get live statistics and play-by-plays;
- Relive all the action with video highlights, Top 10 Plays and recaps;
- Turn on push notifications to receive news and videos catered to you.
More information on: womenseurobasket.basketball

L'App ufficiale di Radio Bianconera, la radio dedicata ai tifosi della Vecchia Signora. Puoi ascoltare la diretta oppure i podcast dei tuoi programmi preferiti.

Con il palinsesto ascolterai:
- ogni giorno speciali, interviste ed esclusive sul mondo bianco nero;
- nei weekend dirette dai campi, gli aggiornamenti degli ultimi minuti, gli aneddoti e gli avversari;
- ancora: news, attualità, ospiti, commenti e riflessioni sul mondo bianconero e su tutto quello che vi gira intorno.

Inoltre troverai:
- tutti i podcast delle tue trasmissioni preferite da ascoltare dove e quando vuoi;
- condivisione di tutti i podcast delle tue trasmissioni preferite con il tuo mondo social;
- la WEB TV in diretta in streaming;
- la possibilità di rimanere sempre informato sull'inizio delle trasmissioni con le notifiche push.

Prova ora gratis Radio BiancoNera, l'unica che conta!
